import React from "react";
import NavbarCustom from "./components/navbar";
import Home from "./components/Home";
import About from "./components/About";
import {BrowserRouter as Router,Switch,Route} from "react-router-dom";
import Login from "./components/Login";
import SignUp from "./components/Signup";
import ProtectedRoute from "./components/Profile";
import CreatePost from "./components/AddPost"


export default class App extends React.Component {
    render() {
      return <Router>
        <div>
        <NavbarCustom/>
        <Switch>
        <Route path="/reactblog/" exact component={Home}/>
        <Route path="/reactblog/about" component={About}/>
        <Route path="/reactblog/login" component={Login}/>
        <Route path="/reactblog/register" component={SignUp}/>
        <Route path="/reactblog/profile" component={ProtectedRoute}/>
        <Route path="/reactblog/new" component={CreatePost}/>

        </Switch>
     </div>
      </Router>;
    }
  }
